import React from "react";

export const Pagefooter = ({ postPerPage, totalPosts }) => {
  const pageNumber = [];

  for (let i = 1; i <= Math.ceil(totalPosts / postPerPage); i++) {
    pageNumber.push(i);
  }
  return (
    <div className="row">
      <div className="col"></div>
      <div className="col"></div>
    </div>
  );
};
